import Lesson from "./lesson"

const Semester = ({ name, socket }) => {
    if (name === "Semestrul 1") {
        socket.emit("first-semester", name)
    } else {
        socket.emit("second-semester", name)
    }

    return (
        <div>
            <div className="card mt15 p15">{name}</div>
            <Lesson lessonName={"Lectia 1"} />
        </div>
    )
}

export default Semester
